import React, {useState, useEffect} from "react";

function Ranking() {

    const [dbData, setDbData] = useState([]);
    let count = 1;

    useEffect(() => {
        fetch('/dbTest')
        .then((res) => res.json())
        .then((data) => setDbData(data.dbData));
    },[])

    return (
        <div>
            <label>JapanSystem</label>
            <br/>
            <label>月間イイね！ランキング</label>
            <br/>
            <br/>
            {/*JSON形式で受け取ったオブジェクトを表示*/}
	        <ul>
                {dbData.map((data) => (
	            <li key={data.postUser} style={{listStyleType:"none"}}>
		            {count++} {data.postUser} {data.likeCount}
	            </li>
                ))}
            </ul>
        </div>
    );
}

export default Ranking;
